  constructor(props) {
    super(props);
    this.state = {
      exercises: []
    };
  }
  componentDidMount() {
    axios
      .get("http://localhost:5000/exercises/")
      .then(el => {
        this.setState({
          exercises: el.data
        });
      })
      .catch(err => console.table(err));
  }

